import drago from '../src/Images/dragon2.png';
const Home = ()=>{
    return(
        // <img src={drago} width="400px" alt="Unable"/>
       <section id="header">
           <div className="container-fluid nav_bg">
            <div className="row">
                <div className="col-10 mx-auto">
                    <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1">
                        <h1>Build your Home with <strong>AlphaCeph</strong></h1>
                        <h2 className="my-3">We are the team of talented developers</h2>
                        <div className="my-3">
                            

                        </div>
                    </div>
                </div>

            </div>

        </div>

       </section>
    )
}

export default Home;
